import Login from '../views/login/login'
import Home from '../views/home/home'

let routes = [
    {
        path: '/',
        name: '登录',
        exact: true,
        component: Login
    },
    {
        path: '/home',
        name: '首页',
        exact: true,
        component: Home
    },
    {
        path: '/user',
        name: '首页',
        exact: true,
        component: User
    },
    {
        path: '/shop',
        name: '首页',
        exact: true,
        component: Shop
    },
]
export default routes;
